import React from 'react'

export default function TaskWindow(props) {





  return (
      <div style={{border: "solid 1px black", margin:"10px"}}>
        <div>{props.task.tName}</div>
        <div>{props.task.tDescription}</div>
        <div>{props.task.tAssigee} </div>
        <button className='roomBtm' onClick={()=>props.setCurrentTask(undefined)}>Close</button>
        <button className='roomBtm' onClick={()=>props.endTask(props.index)}>End</button>
        {endTask()}
    </div>
  )
}
